import React from 'react'
import JsPDF from 'jspdf'
import moment from 'moment'
import i18n from '../../i18n'
import _ from 'lodash'
import { METRIC_STATUS } from '../Constants'

export default {
  images: {
    close:
      'data:image/png;base64,',
    check:
      'data:image/png;base64,',
    noApply:
      'data:image/png;base64,'
  },
  image:
    'data:image/png;base64,',
  maxWidth: 445,
  maxHeight: 842,
  margin: 15,
  cursor: 185,
  doc: {},
  generate (data, mapNavigationSummary) {
    this.resetCursor()
    var doc = new JsPDF({
      unit: 'px'
    })

    this.doc = doc

    // ---------------------------------------------
    // Headers
    // ---------------------------------------------

    // headers
    doc.addImage(this.image, 'png', this.margin, 15, 100, 40)
    doc.setFontSize(11)
    doc.text(
      moment().format(i18n.t('general.format.datetime')),
      this.maxWidth - this.margin - 80,
      40
    )

    // ---------------------------------------------
    // dados gerais
    // ---------------------------------------------

    // Content data globals
    doc.setFontSize(14)

    // header
    // doc.setTextColor(255, 0, 0)
    doc.text(i18n.t('report.title.generalData'), this.margin, 90)
    doc.line(this.margin, 100, this.maxWidth - this.margin, 100, 'FD')

    // content general
    doc.setFontSize(12)

    // label
    doc.text(
      i18n.t('report.table.title.device'),
      this.margin + (this.maxWidth / 4) * 0,
      120,
      {
        renderingMode: 'fillThenStroke'
      }
    )
    // value
    doc.text(data.device.name, this.margin + (this.maxWidth / 4) * 0, 135)

    // label
    doc.text(
      i18n.t('report.table.columns.date'),
      this.margin + (this.maxWidth / 4) * 1,
      120,
      {
        renderingMode: 'fillThenStroke'
      }
    )
    // value
    doc.text(
      moment(data.date).format(i18n.t('general.format.date')),
      this.margin + (this.maxWidth / 4) * 1,
      135
    )

    // label
    doc.text(
      i18n.t('report.table.title.user'),
      this.margin + (this.maxWidth / 4) * 2,
      120,
      {
        renderingMode: 'fillThenStroke'
      }
    )
    // value
    doc.text(data.user.name, this.margin + (this.maxWidth / 4) * 2, 135)

    // label
    doc.text(
      i18n.t('report.table.columns.consistency'),
      this.margin + (this.maxWidth / 4) * 3,
      120,
      {
        renderingMode: 'fillThenStroke'
      }
    )
    // value
    doc.text(
      `${data.consistency.toFixed(2).toString()}%`,
      this.margin + (this.maxWidth / 4) * 3,
      135
    )

    // ---------------------------------------------
    // sumario
    // ---------------------------------------------

    // Content data globals
    doc.setFontSize(14)

    // header
    // doc.setTextColor(255, 0, 0)
    doc.text(i18n.t('report.title.summary'), this.margin, 170)
    doc.line(this.margin, 180, this.maxWidth - this.margin, 180, 'FD')

    this.setSummary(doc, mapNavigationSummary)

    // ---------------------------------------------
    // Detalhamento
    // ---------------------------------------------

    // Content data globals
    doc.setFontSize(14)

    // reset cursor
    // this.resetCursor()

    // header
    // doc.setTextColor(255, 0, 0)
    // up cursor
    this.setCursor(40)

    doc.text(i18n.t('report.title.detailing'), this.margin, this.cursor)

    data.screens.map((screen, screenIndex) => {
      // up cursor
      this.setCursor(10)

      // line divider
      doc.line(
        this.margin,
        this.cursor,
        this.maxWidth - this.margin,
        this.cursor,
        'FD'
      )

      // up cursor
      this.setCursor(20)

      // nome da tela
      doc.setFontSize(14)
      doc.text(`${screenIndex + 1} ${screen.label}`, this.margin, this.cursor, {
        renderingMode: 'fillThenStroke'
      })

      // up cursor
      this.setCursor(13)

      doc.setFontSize(11)
      doc.text(screen.description, this.margin, this.cursor, {
        maxWidth: this.maxWidth - this.margin - 170
      })

      if (screen.image) {
        doc.addImage(
          screen.image,
          screen.image
            .split(';')[0]
            .split('/')[1]
            .toUpperCase(),
          this.maxWidth - 160,
          this.cursor,
          150,
          150,
          null,
          'SLOW'
        )
      }

      // up cursor
      this.setCursor(90)

      // observações
      if (screen.comments === '') {
        doc.setFontSize(11)
        doc.text(i18n.t('report.title.comments'), this.margin, this.cursor, {
          renderingMode: 'fillThenStroke'
        })

        this.setCursor(15)
        doc.text(screen.comments || '', this.margin, this.cursor, {
          maxWidth: this.maxWidth - this.margin - 170
        })
      }

      this.setCursor(90)

      doc.line(
        this.margin,
        this.cursor,
        this.maxWidth - this.margin,
        this.cursor,
        'FD'
      )

      screen.items.map((item, itemIndex) => {
        // nome do item
        this.setCursor(15)
        doc.setFontSize(11)

        // nome do item de avaluação
        doc.text(
          `${screenIndex + 1}.${itemIndex + 1} ${item.name}`,
          this.margin,
          this.cursor,
          {
            renderingMode: 'fillThenStroke'
          }
        )

        // label metricas
        this.setCursor(15)
        doc.setFontSize(11)
        doc.text(i18n.t('report.title.metrics'), this.margin, this.cursor)
        this.setCursor(5)
        doc.line(
          this.margin,
          this.cursor,
          this.maxWidth - this.margin,
          this.cursor,
          'F'
        )
        item.metrics.map(metric => {
          let iconImage = ''
          this.setCursor(20)
          doc.setFontSize(11)

          switch (metric.accepted) {
            case METRIC_STATUS.NO:
              iconImage = this.images.close
              break
            case METRIC_STATUS.YES:
              iconImage = this.images.check
              break
            default:
              iconImage = this.images.noApply
          }

          doc.addImage(
            iconImage,
            'PNG',
            this.margin + 10,
            this.cursor - 5,
            5,
            5,
            null,
            'SLOW'
          )

          // titulo da metrica
          doc.text(metric.title, this.margin + 20, this.cursor, {
            maxWidth: this.maxWidth - this.margin - 30
          })
        })
        this.setCursor(25)
      })
    })

    // ---------------------------------------------
    // Save
    // ---------------------------------------------
    // end save
    doc.save( `report-device-${data.device.name}-${new Date().getTime()}.pdf`)
    // return doc.output('datauri')
  },
  setCursor (num) {
    this.cursor += num
    if (this.cursor >= this.maxHeight - 250) {
      this.cursor = 20
      this.doc.addPage()
    }
  },
  resetCursor () {
    this.cursor = 185
  },

  recursiveSummary (doc, data, cursor, recuo, agregade) {
    return data.map((item, i) => {
      this.cursor += 13
      cursor += 13

      doc.text(`${i + 1} - ${item.label}`, this.margin + 10 * recuo, cursor)

      if (item.children) {
        let spaceChildren = this.recursiveSummary(
          doc,
          item.children,
          cursor,
          recuo + 1,
          agregade
        )

        if (!_.isEmpty(spaceChildren)) {
          cursor = spaceChildren[spaceChildren.length - 1]
        }
      }

      return cursor
    })
  },

  setSummary (doc, mapNavigationSummary) {
    return this.recursiveSummary(
      doc,
      mapNavigationSummary[0].children,
      this.cursor,
      0,
      0
    )
  }
}
